          = (HsJSONPB.pairs ["hash" .= f1, "metadatahash" .= f2])
 
instance HsJSONPB.FromJSONPB CDSData where
        parseJSONPB
          = (HsJSONPB.withObject "CDSData"
               (\ obj ->
                  (Hs.pure CDSData) <*> obj .: "hash" <*> obj .: "metadatahash"))
 
instance HsJSONPB.ToJSON CDSData where
